import React from "react";
import { Link } from 'react-router-dom';
import './Navbar.css';
import Products from "../../Pages/Products";

function Navbar() {
  const handleMassDelete = () => {
    // Perform the mass deletion logic here using the selectedProducts array
    // You can send a DELETE request to the API to delete multiple products at once
  };

  return (
    <>
      <nav className="navbar navbar-expand-lg" data-bs-theme="dark">
        <div className="container-fluid">
          <ul className="navbar-nav">
            <li className="nav-item logo nav-header custom-link">
              <Link to="/">Product List</Link>
            </li>
          </ul>
          <ul className="nav nav-pills margin-right">
            <li className="nav-item custom-link">
              <Link className="btn btn-success" to="/addproduct">ADD</Link>
            </li>
            <li className="nav-item ms-1 custom-link">
              <button className="btn btn-danger" id="delete-product-btn" onClick={handleMassDelete}>
                MASS DELETE
              </button>
            </li>
          </ul>
        </div>
      </nav>

      <div className="line"></div>
      <br></br>
      <Products />
      <br></br>

      <div className="footer">
        <div className="line"></div>
        <h4>Scandiweb Test Assignment</h4>
      </div>
    </>
  );
}

export default Navbar;
